/*!

=========================================================
* BLK Design System React - v1.2.1
=========================================================

* Product Page: https://www.creative-tim.com/product/blk-design-system-react
* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/blk-design-system-react/blob/main/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
//import classnames from "classnames";
// reactstrap components
import {
  //TabContent,
  //TabPane,
  Container,
  Row,
  //Col,
  //Card,
  //CardHeader,
  //CardBody,
  //Nav,
  //NavItem,
  //NavLink
} from "reactstrap";

import { ThirdwebProvider, useContract } from "@thirdweb-dev/react";

export default function Tabs() {

  // the below info is SDK needed to call blockchain
  //const sdk = new ThirdwebSDK("goerli");
  //const contract = await sdk.getContract("0x5c035F0E633961b6F53fF2B7EfC7423229ecAAb8");



  //const [iconTabs, setIconsTabs] = React.useState(1);
  //const [textTabs, setTextTabs] = React.useState(4);



  return (
    <div
    className="section section-tabs"
    data-background-color="black"
    id="tabs-section"
  >

      <Container>

        <div className="title">
          <h3 className="mb-3">Boostr Membership</h3>
        </div>
        <Row>

        <ThirdwebProvider activeChain="goerli">
          <Component />
        </ThirdwebProvider>

        </Row>
      </Container>
    </div>
  );
}

function Component() {
  const { contract, isLoading } = useContract("0xB500BCd2A135b2b2b24da84E09AAFB05f0749631");
}
